import React, { useState } from 'react';
import { Router, Link } from "@reach/router"
import Header from "./Components/Header"
import Display from "./Components/Display"
import Registration from "./Components/Registration"
import One from "./Components/One"
import New from "./Components/New"
import Update from "./Components/Update"
import Visualizer from "./AlgoVisualizer/Visualizer"
import './App.css';


function App() {
  return (
    <div>
      <div className="App">
        <div>
          <h1 style={{margin:"40px 0px 0px 0px"}}>Research is Art</h1>
          <h3>An Algorithm Visualizer</h3>
          <h4></h4>
          <h5>A full stack Javascript Project n using Express, React, Mongoose and Node to further explore algorithms. 
            </h5>
        </div>
        <Router>
          <Visualizer path="/"/>
          <Registration path="/new"/>
          <Display path="/algos/"/>
          <New path="/algos/:id/newAlgo"/>
          <Update path="/algos/:id/:aid/update"/>
          <One path="/algos/:id/:aid"/>
        </Router>
        <nav className="text-center" style={{margin:"4% 50% 0% 0%", height:"75px", width:"100%"}}>
          <Link to="/">Visualizer</Link> |&nbsp;
          <Link to="/algos/">All our Algos are not here</Link>  |&nbsp;
          <Link to="/new">Add an Algo</Link> |&nbsp;
          <Link to="/pathfinder">Playground</Link> |&nbsp;
          <Link to="/one/">Random Algo</Link> |&nbsp;
          <Link to="/">Login</Link>
        </nav>
      </div>
    </div>
  );
}

export default App;
